pragma solidity ^0.4.4;
import './User.sol';
import { IREO } from './LiquidRE/IREO.sol';

contract Trustee is User {

    string public name;
    address[] public trusts;
    address[] public IREOs;
    address[] public LRETs;

    function Trustee(
        address _dexRE,
        address _liquidRE,
        address _owner,
        string _name
    )
        public
        User(msg.sender, _owner, _dexRE, _liquidRE)
    {
        name = _name;
    }

    function trustAddresses()
        public
        view returns(address[])
    {
        return trusts;
    }

    function addTrust(address _trust)
        public
        adminOnly
    {
        trusts.push(_trust);
    }

    function IREOsAddresses()
        public
        view returns(address[])
    {
        return IREOs;
    }

    function addIREO(address _IREO)
        public
        adminOnly
    {
        IREOs.push(_IREO);
    }

}
